script: |
  super -f text -I q12701.spq | sort > q12701.out

inputs:
  - name: q12701.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab2 (FORMAT parquet) WHERE ( - col1 <> + - col0 * - col0 * + + col2 + - 93 + col2 ) OR NOT - col0 + 46 < + col1 + + ( col2 + col2 );
  - name: tab2

outputs:
  - name: q12701.out
    data: |
      46
      64
      75
